由题意可得 $f'(1)=0$,即

$$
\begin{aligned}
\frac{2b+1}{a} &= 0 \\
2b+1 &= 0 \\
b &= -\frac{1}{2}
\end{aligned}
$$

又因为 $f(1)=\frac{b}{a+1}$,即

$$
\begin{aligned}
\frac{b}{a+1} &= \frac{-\frac{1}{2}}{a+1} \\
\frac{2b+1}{a} &= 0 \\
b &= -\frac{1}{2}
\end{aligned}
$$

因此， $a=-2,b=-\frac{1}{2}$。所以答案为 D。
